def clumps(Genome, k, L, t):
    genlen = len(Genome)
    nwords = L - k + 1
    words = []
    wordset = set()
    for i in range(genlen):
        words = []
        if i+L > genlen:
            break
        frame = Genome[i:i + L]
        for j in range (nwords):
            word = frame[j:j + k]
            words.append(word)
        for aword in words:
            count = words.count(aword)
            if count == t:
                wordset.add(aword)
    print(' '.join(wordset))

clumps ("", 12, 600, 20)